import { ArrowLeftOutlined } from "@material-ui/icons";
import styled from "styled-components"

const Container = styled.div`
    width: 100%;
  height: 100vh;
  display: flex;
  position: relative;
  overflow: hidden;
`;

const Slider = () => {
  return (
    <Container>
        <Arrow>
            <ArrowLeftOutlined/>
        </Arrow>
    </Container>
  )
}

export default Slider
